    false,nt"url": null,nt"notes": "This annual narrative report for Detroit
    Lakes Wetland Management District summarizes refuge activities during fiscal year
    1998.  The report begins with an introduction to the refuge and a summary of the
    yearu2019s highlights and climatic conditions.  Information about monitoring and
    studies- including waterfowl and non-game birds - is provided next.  Habitat restoration
    and management projects are also covered; activities include wetland and upland
    restoration, water level management, moist soil management, prescribed burning,
    and invasive plant control.  Fish and wildlife management is discussed next with
    emphasis on bird banding and predator control. Coordination activities, such as
    agency partnerships and private land activities are outlined.  The resource protection
    section provides information about law enforcement, wildfire preparedness, and land
    acquisition.  Information about public education and recreation is given including
    visitor services and outreach programs.  Finally, refuge planning and administration
    are discussed.",nt"license_title": "License Not Specified",nt"extras":
